import {  Box, TMenuButton, Menu, Drawer } from ''
import { useState } from "react";

const [ open, setOpen] = useState(false);
  const handleOpen = () => {
    setOpen(true);
  }
  const handleClose = () => {
    setOpen(false);
  }

const MenuIcon = () => {
    return (
        <>
        <MenuButton color="inherit" onClick={handleOpen}>
          <Menu />
        </MenuButton>
        <Drawer open={open} onClose={handleClose}>hello</Drawer>
        </>
    )
}
export default MenuIcon;
